import React from "react";
import {BrowserRouter} from "react-router-dom";

const Home = () => {
    return (
        <BrowserRouter>
            <div style={{marginTop:"30px",marginLeft:"20px"}}>
                <p style={{fontSize:"30px"}}>张三</p>
                <p>超级管理员</p>
                <hr/>
                <div>
                    上次登录：
                </div>
            </div>
        </BrowserRouter>
    )
}

export default Home;
